__NUXT_JSONP__("/drugs/Mivavotinib", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1312691-33-0",chebiId:b,chemicalFormula:b,definition:"An inhibitor of spleen tyrosine kinase (syk), with potential anti-inflammatory, immunomodulating, and antineoplastic activities. Spleen tyrosine kinase inhibitor mivavotinib may inhibit the activity of syk, which abrogates downstream B-cell receptor (BCR) signaling and leads to an inhibition of B-cell activation, chemotaxis, adhesion and proliferation. Syk, a BCR-associated non-receptor tyrosine kinase that mediates diverse cellular responses, including proliferation, differentiation, and phagocytosis, is expressed in hematopoietic tissues and is often overexpressed in hematopoietic malignancies.",fdaUniiCode:"8QR88H79VX",identifier:"C113162",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C129825","C1967"],synonyms:["3H-Pyrrolo(3,4-C)pyridin-3-one, 6-(((1R,2S)-2-aminocyclohexyl)amino)-7-fluoro-1,2-dihydro-4-(1-methyl-1H-pyrazol-4-yl)-","MIVAVOTINIB",a,"Spleen Tyrosine Kinase Inhibitor TAK-659","Spleen Tyrosine Kinase Inhibitor TAK659","TAK-659","TAK659","syk Inhibitor TAK-659","syk Inhibitor TAK659","syk-Inhibitor TAK-659","syk-Inhibitor TAK659"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FMivavotinib",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Mivavotinib","","2021-10-30T13:18:31.583Z")));